import React from 'react';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Manatee from './pages/home';
import Narwhal from './pages/contact';

function App() {
  return (
    <div className="wrapper">
      <h1>Marine Mammals</h1>
      <BrowserRouter>
        <Switch>
          <Route path="/">
            <Manatee />
          </Route>
          <Route path="/">
            <Narwhal />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
